class Solution:   
    def calculateMinimumHP(self, dungeon: list[list[int]]) -> int:        
        row, col = len(dungeon), len(dungeon[0])
        health = [[None for c in range(col)] for r in range(row)]
        
        start = 1
        for c in range(1, col + 1):
            if dungeon[row - 1][col - c] < 0:  
                start = start + abs(dungeon[row - 1][col - c])              
            else:
                start = 1 if dungeon[row - 1][col - c] >= start else start - dungeon[row - 1][col - c]
            health[row - 1][col - c] = f'{start:2d}'

        start = 1
        for r in range(1, row + 1):
            if dungeon[row - r][col - 1] < 0:
                start = start + abs(dungeon[row - r][col - 1])
            else:
                start = 1 if dungeon[row - r][col - 1] >= start else start - dungeon[row - r][col - 1]
            health[row - r][col - 1] = f'{start:2d}'

        for r in range(2, row + 1):
            for c in range(2, col + 1):
                start1 = int(health[row - (r - 1)][col - c])
                start2 = int(health[row - r][col - (c - 1)])
                if dungeon[row - r][col - c] < 0:
                    start1 = start1 + abs(dungeon[row - r][col - c]) 
                    start2 = start2 + abs(dungeon[row - r][col - c])
                else:
                    start1 = 1 if dungeon[row - r][col - c] >= start1 else start1 - dungeon[row - r][col - c]
                    start2 = 1 if dungeon[row - r][col - c] >= start2 else start2 - dungeon[row - r][col - c]
                health[row - r][col - c] = f'{min(start1, start2):2d}'  
                
        print(row, 'x', col)
        print(*dungeon, sep='\n')
        print()
        print(*health, sep='\n')
        return health[0][0]
    
import random
m = random.randint(1, 40)
n = random.randint(1, 40)
matrix = [[random.randint(-20, 20) for c in range(n)] for r in range(m)]


print(Solution().calculateMinimumHP(matrix))

class Solution:
    def firstCompleteIndex(self, arr: list[int], mat: list[list[int]]) -> int:
        row, col = len(mat), len(mat[0])
        index_mat = [[arr.index(num) for num in row] for row in mat]
        # print(*mat, sep='\n')
        # print()
        # print(*index_mat, sep='\n')
        return min([max(row) for row in index_mat] + [max(row) for row in zip(*index_mat)])
                    

